    <style>
        .mat-drawer-container {
            position: relative;
            z-index: 1;
            box-sizing: border-box;
            -webkit-overflow-scrolling: touch;
            display: block;
            overflow: hidden
        }

        .mat-drawer-container[fullscreen] {
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            position: absolute
        }

        .mat-drawer-container[fullscreen].mat-drawer-container-has-open {
            overflow: hidden
        }

        .mat-drawer-container.mat-drawer-container-explicit-backdrop .mat-drawer-side {
            z-index: 3
        }

        .mat-drawer-container.ng-animate-disabled .mat-drawer-backdrop,
        .mat-drawer-container.ng-animate-disabled .mat-drawer-content,
        .ng-animate-disabled .mat-drawer-container .mat-drawer-backdrop,
        .ng-animate-disabled .mat-drawer-container .mat-drawer-content {
            transition: none
        }

        .mat-drawer-backdrop {
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            position: absolute;
            display: block;
            z-index: 3;
            visibility: hidden
        }

        .mat-drawer-backdrop.mat-drawer-shown {
            visibility: visible
        }

        .mat-drawer-transition .mat-drawer-backdrop {
            transition-duration: 400ms;
            transition-timing-function: cubic-bezier(0.25, 0.8, 0.25, 1);
            transition-property: background-color, visibility
        }

        .cdk-high-contrast-active .mat-drawer-backdrop {
            opacity: .5
        }

        .mat-drawer-content {
            position: relative;
            z-index: 1;
            display: block;
            height: 100%;
            overflow: auto
        }

        .mat-drawer-transition .mat-drawer-content {
            transition-duration: 400ms;
            transition-timing-function: cubic-bezier(0.25, 0.8, 0.25, 1);
            transition-property: transform, margin-left, margin-right
        }

        .mat-drawer {
            position: relative;
            z-index: 4;
            display: block;
            position: absolute;
            top: 0;
            bottom: 0;
            z-index: 3;
            outline: 0;
            box-sizing: border-box;
            overflow-y: auto;
            transform: translate3d(-100%, 0, 0)
        }

        .cdk-high-contrast-active .mat-drawer,
        .cdk-high-contrast-active [dir=rtl] .mat-drawer.mat-drawer-end {
            border-right: solid 1px currentColor
        }

        .cdk-high-contrast-active [dir=rtl] .mat-drawer,
        .cdk-high-contrast-active .mat-drawer.mat-drawer-end {
            border-left: solid 1px currentColor;
            border-right: none
        }

        .mat-drawer.mat-drawer-side {
            z-index: 2
        }

        .mat-drawer.mat-drawer-end {
            right: 0;
            transform: translate3d(100%, 0, 0)
        }

        [dir=rtl] .mat-drawer {
            transform: translate3d(100%, 0, 0)
        }

        [dir=rtl] .mat-drawer.mat-drawer-end {
            left: 0;
            right: auto;
            transform: translate3d(-100%, 0, 0)
        }

        .mat-drawer[style*="visibility: hidden"] {
            display: none
        }

        .mat-drawer-inner-container {
            width: 100%;
            height: 100%;
            overflow: auto;
            -webkit-overflow-scrolling: touch
        }

        .mat-sidenav-fixed {
            position: fixed
        }
    </style>
